  storecreditclient:
    hash: '{cipher}{key:version_1}'
  auth:
    client:
      provider:
        encryption:
          encoded-key: '{cipher}{key:version_1}'
    security:
      oauth2:
        encodedprivatekey: '{cipher}{key:version_1}'
        encodedpublickey: '{cipher}{key:version_1}'
        encodedpublickeys:
          '1': '{cipher}{key:version_1}'
  sandbox:
    preview:
      decoder:
        encoded-public-key: '{cipher}{key:version_1}'
  resource:
    security:
      oauth2:
        encodedpublickey: '{cipher}{key:version_1}'
        encodedpublickeys:
          '1': '{cipher}{key:version_1}'
server:
  ssl:
    key-store-password: '{cipher}{key:version_1}'
